export function List() {

    // Javascript 코딩 영역
    const products = [
        {title: "Banana"},
        {title: "Apple"},
        {title: "Grape"},
    ];

    /* <li>Banana</li>
       <li>Apple</li>
       <li>Grape</li> */

    return (
    <>
        <h1>List Components</h1>
        <p>리액트 연습 코드</p>
        <ul>
            {
                products.map((p)=> (
                    <li>{p.title}</li>
                ))
            }
        </ul>
    </>);
}
